import React from 'react';
import Grid from '@mui/material/Grid';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import me from '../src/me.svg';
import notion1 from '../src/notion1.svg';
import notion2 from '../src/notion2.svg';
import notion3 from '../src/notion3.svg';
import Processsteps from './Processsteps';
import Process from './Process';

function Processcomponent() {
  return (
    <Container
      maxWidth="xl"
      style={{
        background: '#F2E7D6',
        position: 'relative',
        padding: '2rem 0', // Add padding for spacing
      }}
    >
      <Grid
        container
        spacing={2} // Adjust spacing between items
        alignItems="flex-start"
        justifyContent="center"
      >
        <Grid item xs={12} md={3}>
          <Process />
        </Grid>
        <Grid item xs={12} md={9}>
          <Processsteps />
        </Grid>
      </Grid>
    </Container>
  );
}

export default Processcomponent;
